package leetcode

import org.junit.jupiter.api.Assertions
import org.junit.jupiter.params.ParameterizedTest
import org.junit.jupiter.params.provider.Arguments
import org.junit.jupiter.params.provider.MethodSource
import java.util.stream.Stream

class FindAnagramsTest {

    @ParameterizedTest
    @MethodSource("additionData")
    fun test(s: String, p: String, expected: List<Int>) {
        Assertions.assertEquals(
            expected,
            `438 Find All Anagrams in a String`().findAnagrams(s, p)
        )
    }

    companion object {
        @JvmStatic
        fun additionData(): Stream<Arguments> {
            return Stream.of(
                Arguments.of(
                    "cbaebabacd",
                    "abc",
                    listOf(0, 6)
                ),
                Arguments.of(
                    "abab",
                    "ab",
                    listOf(0, 1, 2)
                ),
                Arguments.of(
                    "abacbabc",
                    "abc",
                    listOf(1, 2, 3, 5)
                ),
                Arguments.of(
                    "baa",
                    "aa",
                    listOf(1)
                ),
                Arguments.of(
                    "",
                    "",
                    listOf(0, 10001)
                ),
            )
        }
    }
}